<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Timeline Animation - Mobile</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .parentDiv {
        min-height: 100vh;
        display: grid;
        place-items: center;
      }

      .wrapper {
        width: 100%;
        max-width: 1160px;
      }

      #mobile_timeline {
        display: none;
      }

      @media (min-width: 320px) and (max-width: 480px) {
        #pc_timeline {
          display: none;
        }

        #mobile_timeline {
          display: block;
        }

        #c_1,
        #c_2,
        #c_3,
        #c_4,
        #c_5 {
          transform-box: fill-box;
          transform-origin: center;
        }

        #c_1:hover,
        #c_2:hover,
        #c_3:hover,
        #c_4:hover,
        #c_5:hover {
          cursor: pointer;
        }

        #c_1:hover #text_1,
        #c_2:hover #text_2,
        #c_3:hover #text_3,
        #c_4:hover #text_4 {
          opacity: 1;
        }

        #stroke_1,
        #stroke_2,
        #stroke_3,
        #stroke_4,
        #stroke_5 {
          opacity: 0;
        }

        #stroke_1,
        #stroke_2,
        #stroke_3,
        #stroke_4,
        #stroke_5,
        #stroke_1_top,
        #stroke_2_top,
        #stroke_3_top,
        #stroke_4_top,
        #stroke_5_top {
          transform-box: fill-box;
          transform-origin: center;
        }

        #text_1,
        #text_2,
        #text_3,
        #text_4 {
          transform-box: fill-box;
          transform-origin: center;
          opacity: 0;
          transition: 0.25s;
        }

        #stroke_1,
        #stroke_2,
        #stroke_3,
        #stroke_4,
        #stroke_5 {
          animation: pulsate1 5s ease-in-out infinite;
        }

        #stroke_2 {
          animation: pulsate2 5s ease-in-out infinite;
        }

        #stroke_3 {
          animation: pulsate3 5s ease-in-out infinite;
        }

        #stroke_4 {
          animation: pulsate4 5s ease-in-out infinite;
        }

        #stroke_5 {
          animation: pulsate5 5s ease-in-out infinite;
        }

        @keyframes pulsate1 {
          0% {
            opacity: 1;
          }

          20% {
            transform: scale(1.5);
            opacity: 0;
          }

          100% {
            transform: scale(1.5);
            opacity: 0;
          }
        }

        @keyframes pulsate2 {
          0%,
          20% {
            opacity: 1;
          }

          40% {
            transform: scale(1.5);
            opacity: 0;
          }

          100% {
            transform: scale(1.5);
            opacity: 0;
          }
        }

        @keyframes pulsate3 {
          0%,
          40% {
            opacity: 1;
          }

          60% {
            transform: scale(1.5);
            opacity: 0;
          }

          100% {
            transform: scale(1.5);
            opacity: 0;
          }
        }

        @keyframes pulsate4 {
          0%,
          60% {
            opacity: 1;
          }

          80% {
            transform: scale(1.5);
            opacity: 0;
          }

          100% {
            transform: scale(1.5);
            opacity: 0;
          }
        }

        @keyframes pulsate5 {
          0%,
          80% {
            opacity: 1;
          }

          100% {
            transform: scale(1.5);
            opacity: 0;
          }
        }
      }
    </style>
